Daniel wakes up hungover to find that his boss, Nicki, brought him to her place following the night of drunken debauchery at the office New Year's Eve party. According to Nicki, a bottle of whiskey gave Daniel some liquid courage and had him asking her some provocative questions at the bash. Now that he's sobering up, Nicki decides it's time to get the real party started...
